      { className: 'p-8 max-w-3xl mx-auto' },
      React.createElement('h2', { className: 'text-2xl font-bold mb-4' }, 'About Me'),
      React.createElement(
        'p',
        null,
        "I'm currently studying Information Technology at [Your University Name]. I enjoy building full-stack web applications and learning new technologies."
      )
    )
  );
}

export default About;
